import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Registration from "./components/registration.component";
import './App.css';

function App() {
    return ( <
        Router >
        <
        div >
        <
        Route exact path = "/"
        component = { Registration }
        /> <
        /div> <
        /Router>
    );
}

export default App;
